class ReviewRequest {
  rating: number;
  bookId: number;
  reviewDescription?: string;

  constructor(rating: number, bookId: number, reviewDescription: string) {
    this.rating = rating;
    this.bookId = bookId;
    this.reviewDescription = reviewDescription;
  }
}

export default ReviewRequest;
